import { Plus, Gear } from "@phosphor-icons/react";

const Left = () => {
    return (
      <div style={{width:"71px", textAlign: 'center', marginTop:"36px"}}>
        <div
            style={{
              width: "26px",
              height: "26px",
              borderRadius: "100px",
              background: "#000000",
              color: "#A0A0A0",
              border: "none",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              textAlign:"center",
              margin: "0 auto"
            }}
          >
            <Plus size={20} color="#FFF" weight="bold" />
          </div>
          <div>
          <Gear size={32} color="#A0A0A0" weigh="FILL" />
          </div>
      </div>
    );
  };

  export default Left;
